@robdiciuccio an issue was reported recently at Airbnb where nullable booleans weren’t being reported correctly, i.e., `NULL` was being cast to `false` per [here](https://stackoverflow.com/questions/34520267/getting-boolean-pandas-column-that-supports-na-is-nullable). 

Is this something which will be resolved by using `PyArrow`? 

cc: @etr2460 @graceguo-supercat

@john-bodley `PyArrow` serialization appears to handle this case correctly. Test case added 
 in https://github.com/apache/incubator-superset/pull/8733/commits/a6e6b797209676f97a1c6c6a7ed631e2594411e5.

I'm hoping to wrap up the remaining timezone issue on this PR later this weekend or Monday (I'm out today).
